import styled from "styled-components";

export const Wrapper = styled.div `
	{	
		display: flex;
		margin: 20px auto;
		font-size: 1em;
		width: 100%;
		height: 2.5em;
		position: absolute;
        top: 0;
        left: 0;
        text-align: center;
	}
`;

export const Logga = styled.div `
	{
		flex:1;
		padding-left: 20px;
		font-size: 1.3em;
		width: 50%;
		height: 2.5em;
        text-align: left;

		@media screen and (max-width: 650px) {
			display: none;
		  }
	}
`;

export const Nav = styled.div `
{
	width: 50%;
	height: 2.5em;
	flex:1;
}
`;

export const SignOut = styled.div `
	{
		flex: 1;
		padding-right: 1em;
		font-size: 1.3em;
		height: 8%;
		position: relative;
    	float: right;
	}
`;
